import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <div className="footer">
            <div className="footer-container">
              <div className="footer-top-info-section">

              </div>
              <div className="footer-bottom-info-section">

              </div>
            </div>
        </div>
    )
}

export default Footer;
